def getPoolOrders(chainId, pool, pool_orders, all_orders):
    pool_orders = pd.json_normalize(pool['datatoken']['orders'])

    # Initialize the DF
    pool_orders['poolId'] = pool['id']
    pool_orders['chainID'] = chainId
    pool_orders['chainName'] = chains[chainId]

    if all_orders is None:
        all_orders = pool_orders
    else:
        all_orders = pd.concat([all_orders, pool_orders])

    return all_orders

def getTransactions(chainId, pool, transactions, all_transactions):
    pool_transactions = pd.json_normalize(pool['transactions'])

    # Initialize the DF
    pool_transactions['poolId'] = pool['id']
    pool_transactions['chainID'] = chainId
    pool_transactions['chainName'] = chains[chainId]

    if all_transactions is None:
        all_transactions = pool_transactions
    else:
        all_transactions = pd.concat([all_transactions, pool_transactions])

    return all_transactions

